package stringPrograms;

public class SwapTwoString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String s1 ="Priyanka";
		
		String s2 ="Priya";
		
		String temp;
		
		temp = s1;
		
		s1 = s2;
		
		s2 = temp;
		
		System.out.println(s1);
		
		System.out.println(s2);
		
	}

}
